g.script:
var opacity1 = 0;
		var opacity2 = 0;
		var opacity3 = 0;
		var opacity4 = 0;
		var opacity5 = 0;
		var opacity6 = 0;
		var flow1 = document.getElementById("flow1");
		var flow2 = document.getElementById("flow2");
		var flow3 = document.getElementById("flow3");
		var flow4 = document.getElementById("flow4");
		var flow5 = document.getElementById("flow5");
		var flow6 = document.getElementById("flow6");
		flow1.setAttribute('opacity', opacity1);
		flow2.setAttribute('opacity', opacity2);
		flow3.setAttribute('opacity', opacity3);
		flow4.setAttribute('opacity', opacity4);
		flow5.setAttribute('opacity', opacity5);
		flow6.setAttribute('opacity', opacity6);
		setInterval(opacity, 50);

		function opacity()
		{ 

			opacity3 += 0.05;
			opacity4 += 0.05;
			if (opacity3 > 0.25 || opacity2 != 0){
				opacity2 += 0.05;
				opacity5 += 0.05;
			}
			if (opacity2 > 0.25 || opacity1 != 0){
				opacity1 += 0.05;
				opacity6 += 0.05;
			}
			flow1.setAttribute('opacity', opacity1);
			flow2.setAttribute('opacity', opacity2);
			flow3.setAttribute('opacity', opacity3);
			flow4.setAttribute('opacity', opacity4);
			flow5.setAttribute('opacity', opacity5);
			flow6.setAttribute('opacity', opacity6);
			if (opacity1 == 1 || opacity1 > 1) {
				if (opacity2 == 1 || opacity2 > 1){
					if (opacity3 == 1 || opacity3 > 1){
						opacity1=0;
						opacity2=0;		
						opacity3=0;
						opacity4=0;
						opacity5=0;
						opacity6=0;
					}
				}							
			}	
			}
